import React from "react";
import { Button, Flex,Image,Link } from "@chakra-ui/react";
import Logo from '../assets/Logo.png'
import { HeaderLinks } from "../utils";
export default function Header() {
	return(
	<Flex width={'100%'} py={'1.8rem'} justifyContent={'space-between'} alignItems={'center'}>
		<Flex gap={'0.6rem'}>
			<Image src={Logo} width={'2.4rem'} height={'2.4rem'} mr={'1.4rem'}/>
			{HeaderLinks.map(item => {
				return <Link px={'1.6rem'} py={'1rem'} href={item.url} key={item.name}>{item.name}</Link>
			})}
		</Flex>
		<Flex>
			<Button variant={'normal'} width={'18rem'} onClick={() => {}}>Trade Now</Button>
		</Flex>
	</Flex>
	)
}
